import logo from '../logo.svg';


class Homepage extends Component {


		render() {
			return(

				<div>

				<img src={logo} width="250" height="250" />

				<h3>Welcome to Travelander</h3>

				<button> Send </button>

				</div>

				);
		}

}
export default Homepage;
